def is_brackets_matched(string):
    opening_brackets = {'(', '[', '{'}
    closing_brackets = {')', ']', '}'}
    bracket_map = {'(': ')', '[': ']', '{': '}'}
    stack = []
    for char in string:
        if char in opening_brackets:
            stack.append(char)
        elif char in closing_brackets:
            if len(stack) == 0 or bracket_map[stack[-1]] != char:
                return False
            stack.pop()
    return len(stack) != 0

